    false,nt"url": null,nt"notes": "This narrative report for Bear River Migratory
    Bird Refuge outlines Refuge accomplishments from February through April of 1941.
    The report begins by summarizing the weather conditions and water conditions during
    this period. Wildlife- including waterbirds, upland game birds, furbearers, predators,
    fish, and disease- is also covered. The Refuge development and maintenance section
    discusses physical developments, plantings, and collections and receipts. Resource
    management is outlined; topics include fur harvesting. A progress report on field
    investigations and applied research is also provided. The public relations section
    of the report describes recreational uses and Refuge visitors. Photographs are attached.",nt"owner_org":
